import React from "react";
import { Link, Switch } from "react-router-dom";

const Home = () => {
  //add whether at the corner

  return (
    <div>
      <h1>Where to go next ? </h1>
      <div>
        <Link to="thailand">Find out more for Thailand</Link>
      </div>
      <div>
        <Link to="malaysia">Find out more for Malaysia</Link>
      </div>
      <div>
        <Link to="korea">Find out more for Korea</Link>
      </div>

      <Routes>
        <Switch>
          <Route path="thailand" element={<Thailand />} />

          <Route path="korea" element={<Korea />} />

          <Route path="malaysia" element={<Malaysia />} />
        </Switch>
      </Routes>
    </div>
  );
};

